import React, { useState } from 'react';

export default function Card(props) {
  const { options, foodName, img } = props;
  const sizeOptions = ['Half', 'Full']; // Options for size
  const quantityOptions = Array.from(Array(6), (e, i) => i + 1); // Quantity options from 1 to 6

  // Default image if none is provided
  const imageUrl = img || "/path/to/default-image.jpeg";

  // Local state for selected size and quantity
  const [size, setSize] = useState(sizeOptions[0]);
  const [quantity, setQuantity] = useState(1);

  // Calculate total price based on size and quantity
  const finalPrice = quantity * (options[size] || 0);

  return (
    <div className="card mt-3" style={{ width: "18rem", maxHeight: "360px" }}>
      <img src={imageUrl} className="card-img-top" alt={foodName} />
      <div className="card-body">
        <h5 className="card-title">{foodName}</h5>
        <div className="container w-100">
          {/* Dropdowns for size and quantity in one line */}
          <div className="d-flex justify-content-between mb-3">
            <div className="w-50">
              <label htmlFor="sizeOptions" className="form-label">Size</label>
              <select
                id="sizeOptions"
                className="form-select bg-success text-white rounded"
                value={size}
                onChange={(e) => setSize(e.target.value)}
              >
                {sizeOptions.map((size) => (
                  <option key={size} value={size}>{size}</option>
                ))}
              </select>
            </div>
            <div className="w-50">
              <label htmlFor="quantity" className="form-label">Quantity</label>
              <select
                id="quantity"
                className="form-select bg-success text-white rounded"
                value={quantity}
                onChange={(e) => setQuantity(Number(e.target.value))}
              >
                {quantityOptions.map((quantity) => (
                  <option key={quantity} value={quantity}>{quantity}</option>
                ))}
              </select>
            </div>
          </div>

          {/* Total Price displayed on the next line */}
          <div className='d-inline h-100 fs-5'>
            â‚¹{finalPrice}/-
          </div>
        </div>
      </div>
    </div>
  );
}
